import React, { useState } from "react";
import {
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  TextField,
} from "@mui/material";

const PopupModal = ({ open, onClose, onOk }) => {
  const [inputValue, setInputValue] = useState("");

  const handleInputChange = (e) => {
    setInputValue(e.target.value);
  };

  const handleOk = () => {
    onOk(inputValue);
    setInputValue("");
  };

  return (
    <Dialog open={open} onClose={onClose}>
      <DialogTitle>Popup Modal</DialogTitle>
      <DialogContent>
        <TextField
          label="Input"
          value={inputValue}
          onChange={handleInputChange}
          fullWidth
          multiline
          autoFocus
        />
      </DialogContent>
      <DialogActions>
        <Button onClick={onClose} color="primary">
          Cancel
        </Button>
        <Button onClick={handleOk} color="primary">
          Ok
        </Button>
      </DialogActions>
    </Dialog>
  );
};

export default PopupModal;
